import React from 'react';


function Hepburn() {
    return (
        <div>
            <h1>Your style icon match is Audrey Hepburn! </h1>
            <img className='resultImg' alt="" src="https://www.biography.com/.image/t_share/MTQ1MTM5NzgyODU3NTMyODI0/audrey-hepburn---a-life-in-full-circle.jpg" />
            <h3 className='resultDescr'>You gravitate toward understated in your styling. You prefer the simple, yet demure.</h3>
        </div>
    );
};



export default Hepburn;
